import React, { Component } from "react";

class App extends Component {
  constructor() {
    super();
  }

  changeFirstName(e) {
    console.log("First name" + e.target.value);
  }

  render() {
    return <div>
      <form>
        <input type="text" placeholder="First Name" onChange={this.changeFirstName}></input>
      </form>
    </div>;
  }
}

export default App;
